select bit_or_blob(prov_c1) as prov_c1, bit_or_blob(prov_o1) as prov_o1, bit_or_blob(prov_l1) as prov_l1 from (
SELECT * FROM (SELECT * FROM (
  SELECT c_custkey, c_name, sum(l_extendedprice * (1 - l_discount)) as revenue, c_acctbal, n_name, c_address, c_phone, c_comment,
  bit_or_ints(prov_c1) as prov_c1, bit_or_ints(prov_o1) as prov_o1, bit_or_ints(prov_l1) as prov_l1
  FROM
(select c_acctbal, c_address, c_name, c_phone, c_comment, c_nationkey, c_custkey, binsearch_ranges_pos(c_custkey, (SELECT bounds_to_blob(b) FROM (VALUES (1),(24402),(49374),(72258),(94998),(117049),(141673),(164917),(188795),(211049),(233872),(255614),(279411),(304966),(326402),(347655),(370473),(393626),(418128),(440249),(460263),(483338),(508790),(532854),(557947),(582018),(605149),(630895),(653876),(677902),(702628),(728661),(753129),(774709),(797954),(819397),(844022),(866971),(890134),(917028),(938601),(963753),(986443),(1009254),(1033086),(1057899),(1080911),(1104419),(1128307),(1151594),(1175230),(1199603),(1222784),(1247083),(1270488),(1295334),(1317975),(1341540),(1364626),(1386545),(1409399),(1430999),(1454522),(1478470),(1500001)) AS g(b))) AS prov_c1 from customer) c1,
(select l_returnflag,l_orderkey, l_shipdate, l_extendedprice, l_discount, binsearch_ranges_pos(l_orderkey, (SELECT bounds_to_blob(b) FROM (VALUES (1),(937639),(1954467),(2895301),(3783459),(4755010),(5606625),(6478113),(7341761),(8250982),(9210565),(10101344),(11021923),(11865697),(12809987),(13623136),(14606439),(15624966),(16564609),(17546528),(18509250),(19346787),(20263265),(21200706),(22205543),(23203073),(24133346),(24924453),(25963139),(26879970),(27823107),(28718436),(29699301),(30704326),(31720770),(32645920),(33699010),(34760198),(35770598),(36764453),(37736481),(38583526),(39513924),(40361830),(41359588),(42169219),(43053063),(44017284),(44920608),(45876290),(46822821),(47772995),(48705920),(49588550),(50533090),(51446178),(52361255),(53389056),(54351168),(55353281),(56268839),(57136612),(58128324),(59113574),(60000001)) AS g(b))) AS prov_l1 from lineitem) ll1,
(select o_shippriority,o_orderdate,o_orderkey,o_custkey, binsearch_ranges_pos(o_orderkey, (SELECT bounds_to_blob(b) FROM (VALUES (1),(999492),(1910561),(2807717),(3702725),(4493698),(5435845),(6394567),(7255013),(8208288),(9100071),(10101444),(11022816),(11884997),(12752261),(13776963),(14780646),(15782241),(16599266),(17504834),(18418369),(19291559),(20365568),(21280483),(22230468),(23183590),(24020263),(24862278),(25758880),(26708583),(27714663),(28647779),(29568070),(30468357),(31376389),(32248835),(33267750),(34225345),(35180129),(36109348),(37058055),(37945092),(38907489),(39741796),(40798563),(41768708),(42718631),(43555264),(44527458),(45499111),(46447623),(47383808),(48360483),(49415074),(50375588),(51412961),(52387236),(53377792),(54306726),(55252419),(56204896),(57178914),(58090947),(59003719),(60000001)) AS g(b))) AS prov_o1 from orders) o1,
nation
WHERE c_custkey = o_custkey and l_orderkey = o_orderkey and o_orderdate >= '1994-12-01' and o_orderdate < '1995-03-01'and l_returnflag = 'R' and c_nationkey = n_nationkey GROUP BY c_custkey, c_name, c_acctbal, c_phone, n_name, c_address, c_comment) o1 ORDER BY revenue desc) o2 limit 20) f;
